export const getSvg=(type)=>{

    switch(type){
        case "Law firm profile" :
          return low_firm_profile ;
        case "Lite" :
          return Light;   
        case "Pro" :
          return Pro;  
        case "Ultimate":
          return Ultimate;    
        case "Manage users":
          return Manage_users;    
        case "profileControlBtn":
          return profileControlBtn;  
        case "Import Image":
          return Import_Image; 
        case "Delete Image":
          return delete_image; 
        case "Clio Connect":
          return Clio_Connect; 
        case "Clio ConnectedOrnot":
          return Clio_ConnectedOrnot; 
        case "Disconnected Clio":
          return disconnected_Clio; 
        case "intuitConnectedOrNot":
          return intuitConnectedOrNot; 
        case "intuitConnectedOrNot_false":
          return intuitConnectedOrNot_false; 
        case "disconnectService":
          return disconnectService; 
        case "refresh":
          return refresh; 
        case "toggleClass":
            return toggleClass; 
        default : return ""
     
    }
   

}